import React from 'react';
import MailIcon from '../../icons8-mail-24.png';

const Mailing = () => {
    return (
        <div className='flex bg-slate-50 text-2xl rounded shadow-md'>
            <img src={MailIcon} alt="icon" />
            <div>Mail</div>
        </div>
    );
}

export default Mailing;
